Sort the scheduled events for a week ending with dTime
@param dTime the time relative to which the events are sorted
@param filter a function to filter the events
@return a map containg the events and the time when they would occur

Determine if an event would occur between two other events. 
This allows for multiple occurances of any of the three events. 
@param sEvent the event that should be in the middle
@param sFirstEvent the first event
@param sLastEvent the last event
@return true if sEvent is always between sFirstEvent and sLastEvent

Get the state based on the time and two scheduled event types.
The state is determined by arranging the events chronologically for the past week up to the day represented
by dTime, allowing for multiple instances of each event type. If the last event to occur before dTime was 
sFirstEvent, the state is true, otherwise it is false.
@param dTime a variant local time
@param sFirstEvent the name of the first event
@param sLastEvent the name of the last event
@return true if the last event before dTime was sFirstEvent
